import React from 'react';

const Activity = ({ activity, onCheck }) => {
    return (
        <div>
            <h3>{activity.activity_name}</h3>
            {activity.confirmed_by && (
                <label>
                    <input
                        type="checkbox"
                        onChange={(e) => onCheck(activity.si_no, e.target.checked)}
                    />
                    Confirmed by: {activity.confirmed_by}
                </label>
            )}
            <p>Time: {activity.hr ? `${activity.hr} hr ` : ''}{activity.min ? `${activity.min} min ` : ''}{activity.sec ? `${activity.sec} sec` : ''}</p>
        </div>
    );
};

export default Activity;
